import React from 'react';
import {
    View,
    Text,

    TouchableOpacity,

    TextInput,

    StyleSheet,
    ScrollView,
    StatusBar,
    ActivityIndicator

} from 'react-native';
{/* <ActivityIndicator size="large" color="#6600ff" style={{justifyContent: "center"}} /> */}


const Home = ({ navigation }) => {
    return (
        <ScrollView contentContainerStyle={{ flexGrow: 1, justifyContent: 'center' }}>
        <View style={{ flex: 1, backgroundColor: '#4700b3' }}>
            <View style={styles.header}>
                <Text>this is header</Text>
                <View style={styles.footer}>
                 <Text>this is footer</Text>
                </View>
           </View>
        </View>
        </ScrollView>
        )
}

const styles = StyleSheet.create({
    header: {
        flex: 0,
        backgroundColor: '#4700b3',
        borderBottomLeftRadius: 30,
        borderBottomRightRadius: 30,
        paddingTop: 20
    },
    footer: {
        flex: 1,
        backgroundColor : '#fff',
        
    }
})

export default Home
